import React, { Component, Fragment } from 'react';
import { Col, Container, Row } from "react-bootstrap";
import TopNavigation from '../components/TopNavigation/TopNavigation';
import TopBanner from "../components/TopBanner/TopBanner";
import Services from '../components/Services/Services';
import VisibilitySensorImage from '../components/VisibilitySensorImage';

import img1 from '../asset/images/1.jpg';
import img2 from '../asset/images/2.jpg';
import img3 from '../asset/images/3.jpg';
import img4 from '../asset/images/4.jpg';


class ServicePage extends Component {
  render() {
    return (
      <Fragment>
      <TopNavigation title="Service"/>
      <TopBanner/>
      <Services/>
        <Container className="text-center">
          <Row>
            <Col lg={4} md={6} sm={12}>
              {[
                img1,
                img2,
                img3,
                img4
              ].map((imgpath) => {
              return  <VisibilitySensorImage src={imgpath} alt="Astronomy Image"/>
              })}
            </Col>
          </Row>
        </Container>
      </Fragment>
    );
  }
}

export default ServicePage;
